import styles from "../styles/Home.module.css";

export default function LinesSvg() {
  return (
    <svg
      version="1.1"
      className={styles.lines}
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      viewBox="0 0 1000 1000"
      x="0px"
      y="0px"
      xmlSpace="preserve"
      preserveAspectRatio="none"
    >
      <style>
        {`.path {
          width: 100%;
          height: 100%;
          fill: none;
          stroke: #2eb6ad;
          stroke-width: 0.3em;
          stroke-miterlimit: 5;
        }
        .path1 {
            stroke-dasharray: 1200;
            stroke-dashoffset: 1200;
            animation: dash 15s linear forwards infinite;
        }

        .path2 {
          stroke-dasharray: 1800;
          stroke-dashoffset: 1800;
          animation: dash 30s linear forwards infinite;
        }

        .path3 {
          stroke-dasharray: 1500;
          stroke-dashoffset: 1500;
          animation: dash 20s linear forwards infinite;
        }

        .path4 {
          stroke-dasharray: 1800;
          stroke-dashoffset: 1800;
          animation: dash 12s linear forwards infinite;
        }

        .path5 {
          stroke-dasharray: 1500;
          stroke-dashoffset: 1500;
          animation: dash 20s linear forwards infinite;
        }

        .path6 {
          stroke-dasharray: 2500;
          stroke-dashoffset: 2500;
          animation: dash 30s linear forwards infinite;
        }

        @keyframes dash {
          to {
            stroke-dashoffset: 0;
          }
        }`}
      </style>
      <path class="path path1" d="M 0 150 H 250 L 600 350 H 1000" />
      <path class="path path2" d="M 1000 100 H 800 L 400 400 H 0" />
      <path class="path path3" d="M 0 600 H 50 L 300 700 H 1000" />
      <path class="path path4" d="M 1000 400 H 700 L 300 800 H 0" />
      <path class="path path5" d="M 0 550 L 150 475 H 1000" />
      <path class="path path6" d="M 1000 275 H 250 L 50 75 H 0" />
    </svg>
  );
}
